        """.stripMargin
        // 1.2 插入样例类
        val source2 = Startup("mid777", "uid222", "", "", "", "", "", "", "", "", "", 123124141)
        val index: Index = new Index.Builder(source2)
            .index("gmall_dau")
            .`type`("_doc")
            .build()
        client.execute(index)
    }
}

